import Form from "react-bootstrap/Form";
import Row from "react-bootstrap/Row";
export const TaskForm = () => {
  return (
    <Form>
      <Row>
        <Col>
          <Form.Control placeholder="First name" />
        </Col>
        <Col>
          <Form.Control placeholder="Last name" />
        </Col>
      </Row>
    </Form>
  );
};
